import { CREATE,FETCH_ALL } from './actionTypes.js'

import * as api from '../api'

export const addPrefences = (formData) => async dispatch => {
  try {
    const { data } = await api.addPrefences(formData)
    dispatch({ type: CREATE, data })
  } catch (error) {
    console.log(error)
  }
}

export const fetchPreferences = (id) => async dispatch => {
  try {
    const { data } = await api.fetchPreferences(id)
    console.log("data from fected preferences",data)
    dispatch({ type: FETCH_ALL,payload: data })

  } catch (error) {
    console.log(error)
  }
}
